import styled from 'styled-components'

export const Content = styled.div`
    width: 100vw;
    height: calc(100vh - 60px);
    display: flex;
    justify-content: center;
    align-items: center;

    @media (min-width:1024px){
        .content {
            max-width: 1366px;
            width: 100%;
            height: 100%;
        }

        .pinkoctober{
            width: 1046px;
            height: 708px;
            border:1px solid pink;
        }
    }
`
